const corporativoData=[{id:"001",src:"./corporativos/2016-17.pdf",title:"2016 - 2017"},{id:"002",src:"./corporativos/2015-16.pdf",title:"2015 - 2016"},{id:"003",src:"./corporativos/2013-14.pdf",title:"2013 - 2014"},{id:"004",src:"./corporativos/2012-13.pdf",title:"2012 - 2013"},{id:"005",src:"./corporativos/2011-12.pdf",title:"2011 - 2012"},{id:"006",src:"./corporativos/2010-11.pdf",title:"2010 - 2011"}],corporativos=document.getElementById("corp-items");corporativoData.forEach(o=>{const r=document.createElement("div");r.classList.add("col-6","col-sm-4","col-lg-2","mx-auto","my-3"),r.innerHTML=`\n    <div class="card corp-card">\n      <a href=${o.src} target="_blank" rel="noopener noreferrer">\n        <div class="img-container">\n          <img src="./img/balance1.jpg" class="card-img-top" alt="imagen de documento" />\n        </div>\n        <div class="card-body corp-card-body">\n          <h5 class="corp-name">${o.title}</h5>\n        </div>\n      </a>\n    </div>\n  `,corporativos.appendChild(r)});